import React from 'react';
import fifty from '../resources/50.png';

export default function Home() {
    return (
        <div className="Home">
            <img src={fifty} alt="50" style={{padding: '1%', width:'13%', height: '13%', float: "left"}} />
            <h2 style={{textAlign:'left', paddingLeft:'1%', color:'#993366', width: "958px", height: "78px"}}>Welcome to Mallard and Claret Fly Fishers Club Inc</h2>
        </div>
    )
}
